export const Skills = () => {
  return (
    <div className="skills">
      <h2>Skills</h2>
      <div className="skill-names">
        <p>C++</p>

        <p>Java</p>

        <p>JavaScript</p>

        <p>Python</p>

        <p>HTML</p>

        <p>CSS</p>

        <p>React</p>

        <p>NextJS</p>

        <p>Spring Boot</p>

        <p>MySQL</p>
      </div>
    </div>
  );
};
